import 'react-toastify/dist/ReactToastify.css';
import InputMask from 'react-input-mask';
import '../register/style.css';
import Button from '../../components/utils/button/button';
import { Formik, Field, Form } from 'formik';

export default function Register() {
  
  
  

  async function submitOn(data) {

    

    try {

      if(data!==''){   
        
        console.log("data>",data)
        
      }else{
        alert("Fill in all data")
      }
    
    } catch (error) {
      const { data } = error.response;
      alert(data.message);
      
    }
        
      
    
}
      
function onblurCrm(e,setFieldValue){

  const {value} = e.target;
  
  if(value === ''){
    return;
  }
  fetch(`https://www.consultacrm.com.br/api/index.php?tipo=crm&uf=am&q=${value}&chave=2798018964&destino=json`)
  .then(data => data.json())
  .then(data =>{
    for(const pessoa of data.item){
      setFieldValue('name', pessoa.nome);
     
      setFieldValue('specialization', pessoa.profissao);
      setFieldValue('crm', pessoa.numero);
      setFieldValue('password');
      
    }
    
  })
  
}
return (
  <div >
    
  <div><a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className={'logo2'} title="source: imgur.com" /></a></div>
    <Formik
      onSubmit={submitOn}
      
      initialValues={{
        
      }}
      render={({ isValid, setFieldValue }) => (
        <Form>
          <h1 className='title'>Register</h1>
      <h2 className='subtitle'>Fill in the information below</h2>
      <div className = {"question"}>
      <Field name="name"  type="text"/>
        <label>Name:</label>
      </div>
      <br></br>
      <div className = {"question"}>
        <Field  name="cpf" type="text" id="cpf" required
          
        />
        
        <label>CPF:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <InputMask mask="9999" name="crm" type="text" required
          
          onBlur={(ev) => onblurCrm(ev, setFieldValue)}
        />
       <label>CRM:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <Field   name="specialization"  type="text" required
          
        />
        <label>Specialization:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <Field mask="(99) 99999-9999" id="phone" name="phone" type="text" required
          
        />
        <label>Phone:</label>   
      </div>
      <br></br>
        <div className={"question"}>
          <input name="email" id="email" type="email" required
          
           />
          <label>E-mail:</label>
        </div>
        <br></br>
        <div className={"question"}>
          <input mask="password" id="password" name="password" type="password" required

          
        />
        <label>Password:</label>
      </div>
      <br></br>
      
      <div>
      
      <Button disabled={!isValid}>Confirm</Button>
    </div>  
        </Form>
      )}
    />
  </div>
);
}
